class HeaderComponent extends Component {
    constructor(props){
        super(props);

        this.state = {

        }
    }
    render() {
        return (
            <div>
                <div>
                <header>
                    <div className="navbar navgab-expand-md navbar-dark bg-success">
                        <div className="navbar-inner">
                            <a className="navbar-brand" href="/">Онлайн журнал</a>
                        </div>
                        <ul className="nav">
                            <li className="active"><a id="headerLink" href="/">Список студентов</a></li>
                            <li style={{marginLeft:"10px"}}><a id="headerLink" href="/groups">Список групп</a></li>
                            <li style={{marginLeft:"10px"}}><a id="headerLink" href="/add-student/-1">Добавить студента</a></li>
                            <li style={{marginLeft:"10px"}}><a id="headerLink" href="/add-group/-1">Добавить группу</a></li>
                        </ul>
                    </div>
                </header>
            </div>
            </div>
        );
    }
}

export default HeaderComponent;
